import StyledRoom from "./styles/StyledRoom";

const Room = () => {
  return (
    <StyledRoom>
      <div>
        v<h3>Room</h3>
        <input type="checkbox" />
        <label for="adults">Adults:</label>
        <select id="adults">
          <option>1</option>
          <option>2</option>
        </select>
        <label for="children">Children:</label>
        <select id="children">
          <option>0</option>
          <option>1</option>
          <option>2</option>
        </select>
      </div>
    </StyledRoom>
  );
};

export default Room;
